FROM ubuntu:22.04

RUN apt update && apt upgrade -y && apt install --no-install-recommends -y curl unzip && rm -rf /var/lib/apt/lists/*;

ARG username=devbox
RUN adduser ${username} && usermod -aG sudo ${username}

RUN curl -f -sL https://deb.nodesource.com/setup_16.x | bash -
RUN apt install --no-install-recommends -y nodejs && rm -rf /var/lib/apt/lists/*;
RUN curl -L -f https://get.volta.sh | bash

RUN apt autoremove

WORKDIR /home/devbox/workspace
